import React from 'react'

const Pods = ({ pods }) => {
  var podList = pods.map(function(pod){
    return (<div>{pod.metadata}</div>);
  });
return (
    <div>
      <center><h1>Pod List</h1></center>
      <div>{podList}</div>
    </div>
  )
};

export default Pods
